    function plan(){
        numPlan = this.id;

        document.querySelector('.nomBien').innerHTML = eval('mdr.' + numPlan).nom;

        document.querySelector('.imageBien').src = '../img/Plans/' + eval('mdr.' + numPlan).planete + '/' + eval('mdr.' + numPlan).img;

        document.querySelector('.typeBien').innerHTML = eval('mdr.' + numPlan).type;

        document.querySelector('.descriptionBien').innerHTML = eval('mdr.' + numPlan).description;

        document.querySelector('.tailleBien').innerHTML = eval('mdr.' + numPlan).taille + 'm²';
        
        document.querySelector('.prixBien').innerHTML = eval('mdr.' + numPlan).prix + ' millions €';

        



        //un code t'as peur
        if(document.querySelector('.Bien').classList[1]=='Bien2'){
            return;
        }
        else{
            document.querySelector('.nomPlanete').classList.add('displayNone');
        document.querySelector('.listeBiens').classList.add('displayNone');
        document.querySelector('.cliquez').classList.add('displayNone');
        document.querySelector('.Bien').classList.add('displayBlock');
        document.querySelector('.Bien').style.display = 'block';
        document.querySelector(".Bien").classList.add("Bien2");
        document.querySelector('.listeBiensPC').style.transform = 'translateX(150%)';
        document.querySelector('.listeBiensPC').style.transition = '0.4s';
        document.querySelector('.listeBiens').style.transform = 'translateX(150%)';
        document.querySelector('.listeBiens').style.transform = 'translate(-100vw)';
        document.querySelector('.listeBiens').style.transition = '0.4s';
        document.querySelector('.plansDe').style.transition = '0.4s';
        document.querySelector('.plansDe').classList.add('displayNone');
        document.querySelector('.plansDe').style.transform = 'translate(100%)';

        setTimeout(listeDisparait, 550);
        function listeDisparait(){
            document.querySelector('.nomPlanete').style.opacity = '0';
            
            document.querySelector('.cliquez').style.opacity = '0';
            document.querySelector('.plansDe').style.opacity = '0';
            document.querySelector('.Bien').style.opacity = '100%';
            
            document.querySelector('.nomPlanete').classList.remove('displayNone');
            document.querySelector('.listeBiens').classList.remove('displayNone');
            document.querySelector('.cliquez').classList.remove('displayNone');
            document.querySelector('.Bien').classList.remove('displayBlock');
            document.querySelector('.plansDe').classList.remove('displayNone');

        }
    }

        }
        
    document.querySelector('.fermerBien').addEventListener('click', fermerPlan);

    function fermerPlan(){
        document.querySelector('.nomPlanete').classList.add('displayBlock');
        document.querySelector('.listeBiens').classList.add('displayBlock');
        document.querySelector('.cliquez').classList.add('displayBlock');
        document.querySelector('.Bien').classList.add('displayNone');
        document.querySelector(".Bien").classList.remove("Bien2");
        document.querySelector('.listeBiensPC').style.transform = 'translate(0)';
        document.querySelector('.listeBiensPC').style.transition = '0.6s';
        document.querySelector('.plansDe').classList.add('displayBlock');
        document.querySelector('.listeBiens').style.transform = 'translate(0)';
        document.querySelector('.plansDe').style.transform = 'translate(0)';
        setTimeout(listeApparait, 550);
        function listeApparait(){
            document.querySelector('.nomPlanete').style.opacity = '100%';
            document.querySelector('.listeBiens').style.display = 'flex';
            document.querySelector('.cliquez').style.opacity = '100%';
            document.querySelector('.Bien').style.display = 'none';
            document.querySelector('.plansDe').style.opacity='100%';

            document.querySelector('.Bien').style.opacity = '0';

            document.querySelector('.nomPlanete').classList.remove('displayBlock');
            
            document.querySelector('.cliquez').classList.remove('displayBlock');
            document.querySelector('.Bien').classList.remove('displayNone');
            document.querySelector('.plansDe').classList.remove('displayBlock');
        }
    }